(556, NULL, NULL, 'Starquake (AKA Star Quake)', '1987', 19, 'R', '<p>This game gives you a password on completing a level. This can be used to skip to the next level the next time the game is played. These may be listed as an easter egg somewhere in the instructions screens. Try pressing P.</p>\r\n<p>Later published on the 8BS Public Domain disc TBI-139</p>', 1, 1, 'O', NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-10-12 12:45:47', '0000-00-00 00:00:00', 0, '2018-08-17 13:50:36', 2, 'N', 'Y', '0'),
(557, NULL, NULL, 'Uridium', '1987', 3, 'R', '<p>This game doesn''t seem to work very well in jsbeeb. In BBC mode it doesn''t work at all, and in master mode it seems stuck in demo mode. Bugs have been raised to document this, jsbeeb issue <a href="https://github.com/mattgodbolt/jsbeeb/issues/130">130</a> <a href="https://github.com/mattgodbolt/jsbeeb/issues/140">140</a> and <a href="https://github.com/mattgodbolt/jsbeeb/issues/152">152</a>. See also a <a href="http://www.stardot.org.uk/forums/viewtopic.php?f=51&amp;t=11165&amp;p=150080&amp;hilit=uridium#p150166">discussion in the stardot forum</a>, and <a href="http://stardot.org.uk/forums/viewtopic.php?f=51&amp;t=13967#p184559">another one here</a>. The play button has been enabled to play it in BBC Master mode, which seems to work best, but it is probably best to download the disc image and play it in an emulator.</p>', 1, 1, 'O', NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-01-24 10:43:37', '0000-00-00 00:00:00', 0, '2017-05-08 21:55:08', 0, 'N', 'Y', '0'),
