(653, NULL, NULL, 'Froglet', '1983', 4, 'R', '<p>The listing for this game was published in the April 1983 issue of Computing Today magazine, and then updated in the June 1983 issue.</p>\r\n<p>I am unsure whether the listing was printed before or after the game was commercially released.</p>', 1, 1, NULL, NULL, NULL, NULL, 'V2C', NULL, NULL, 2, '2018-11-09 11:12:16', '0000-00-00 00:00:00', 0, '2017-05-08 21:56:59', 0, 'N', 'Y', '0'),
