(655, NULL, NULL, 'Jam Butty', '1985', 4, 'R', 'First advertised in Electron User magazine volume 2, issue 8 in May 1985.\r\n<br>Sold on the "Ten of the best" compilation, which consisted of games previously listed in Electron User magazine.\r\n<br>Jam Butty was the only game on this compilation which was not previously listed in the magazine.\r\n<br>Therefore you had to purchase the cassette if you wanted this game.\r\n<br>Later released by Alternative on the Triple Decker 03 compilation.', 1, 1, NULL, NULL, NULL, NULL, NULL, 'Triple Decker', '03', 2, '2017-12-18 12:02:42', '0000-00-00 00:00:00', 0, '2017-05-08 21:57:02', 0, 'N', 'Y', '0'),
(656, NULL, NULL, 'Lawn Tennis', '1984', 478, 'M', '<p>Published on the "Model B Computing" cassette number 6 in August/September 1984.</p>\r\n<p>This game may not be playable without a joystick. Jsbeeb does not currently emulate a joystick so it might not be possible to play this game on the website. Try using an emulator or a real BBC.</p>', 2, 2, 'R', NULL, NULL, NULL, NULL, 'Model B Computing Cassette', '06', 1, '2018-01-06 21:47:25', '0000-00-00 00:00:00', 0, '2018-01-06 21:46:59', 1, 'N', 'Y', '0'),
