(1068, NULL, NULL, 'Dunjunz', '1986', 36, 'R', '<p>For instructions and more information see&nbsp;<a href="http://8bs.com/elecgame/dunjunz.htm">http://8bs.com/elecgame/dunjunz.htm</a></p>\r\n<p>If you are playing this game on a real BBC micro, it requires two banks of <a href="https://en.wikipedia.org/wiki/Sideways_address_space">Sideways RAM</a>, which must be banks 4 and 5.</p>\r\n<p>To run Dunjunz with a <a href="http://www.retroclinic.com/acorn/datacentre/datacentre.htm">DataCentre</a>, see <a href="http://www.stardot.org.uk/forums/viewtopic.php?f=1&amp;t=13214#p172123">the Dunjunz compatibility matrix</a>.</p>\r\n<p>&nbsp;</p>', 1, 4, NULL, NULL, '2 x Banks SWR Required', NULL, NULL, NULL, NULL, 3, '2018-06-22 14:12:01', '0000-00-00 00:00:00', 0, '2018-06-22 10:01:16', 2, 'N', 'Y', '0'),
