(1925, NULL, NULL, 'Ultima', '1990', 31, 'M', '<p>Published in Micro User Magazine vol.8 issue 5 in July 1990</p>\r\n<p>Another version of this game had already been published in Personal Software magazine, Spring 1983 edition.</p>\r\n<p>This variation on Chess was invented in 1962 by Robert Abbott. It was originally called <a href="https://en.wikipedia.org/wiki/Baroque_chess">Baroque Chess</a>, but was changed to Ultima at the suggestion of his publisher.</p>\r\n<p>Some variations to the rules exist.</p>', 2, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-11-07 16:36:25', '0000-00-00 00:00:00', 0, '2018-10-06 10:41:08', 2, 'N', 'Y', '0'),
