(1928, NULL, NULL, 'Asteroid Lander', '1982', 569, 'R', '<p>This game was sold in a double-pack with <a href="game.php?id=1958">Pete The Plastered Postman.</a></p>\r\n<p>The (slightly buggy) game listing was published in the September 1982 issue of Personal Computing Today, but I am unsure as to whether this was before, or after the professional release.</p>\r\n<p>The game listing was later published in the July/August 1983 issue of A&amp;B Computing.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-11-13 16:30:16', '0000-00-00 00:00:00', 0, '2017-05-08 22:21:35', 0, 'Y', 'Y', '0'),
