(2082, NULL, NULL, 'Dracula''s Castle (AKA Count Dracula''s Castle) (AKA Mini Adventure)', '1987', 13, 'M', 'Published in Electron User magazine volume 5, issue 3 in December 1987, in part 6 of the adventure writing series on page 53.\r\n<br>Published on the "Adventure Anthology" compilation, which was first advertised in Electron User volume 5, issue 8 in May 1988.\r\n<br>The compilation consisted of 4 adventures previously published in the pages of Electron User, PLUS "Johnny" by Bill Trevelyan which was previously unpublished.', 1, 1, NULL, NULL, NULL, 'Y', NULL, '', NULL, 2, '2017-12-18 14:33:42', '0000-00-00 00:00:00', 0, '2018-09-12 18:56:21', 2, 'N', 'Y', '0'),
