(2123, NULL, NULL, 'Haunted House', '1983', 13, 'B', '<p><em>Haunted House</em> may be found as a type-in listing in <em>Write Your Own Adventure Programs</em>, a free PDF of this book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>\r\n<p>Later published on the Electron User Group PD Disc 59 in July 2001.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-10-10 19:08:52', '0000-00-00 00:00:00', 0, '2017-05-06 20:32:44', 0, 'N', 'Y', '0'),
(2124, 2123, NULL, 'Haunted House [hack]', '1983', 13, 'L', '<p>This is an expanded version of the <a title="Haunted House" href="game.php?id=2123"><em>Haunted House</em></a> game published in the Usborne book <a href="https://drive.google.com/file/d/0Bxv0SsvibDMTYkFJbUswOHFQclE/view">Write Your Own Adventure Programs for your micromputer, by Jenny Tyler and Les Howarth</a>. <br />Usborne have generously <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">released their vintage programming books</a>, including this one to the public. Thank you Usborne!</p>\r\n<p>Later published in 8BS issue 62 - Expanded by Jack Foster, and published by 8BS, possibly without the knowledge that it was essentialy an Usborne copyrighted game!</p>', 1, 1, NULL, NULL, NULL, NULL, 'Expanded', NULL, NULL, 2, '2018-10-12 12:20:10', '0000-00-00 00:00:00', 0, '2017-05-06 20:32:46', 0, 'N', 'Y', '0'),
