(2126, NULL, NULL, 'Holmes: The Mystery Of The Dark Shadow', '1986', 13, 'W', '<p>This is the demo adventure that was included with Logotron''s PenDown Adventure Writer software.</p>', 1, 1, NULL, 'D', NULL, NULL, NULL, NULL, NULL, 2, '2018-03-09 14:19:48', '0000-00-00 00:00:00', 0, '2017-05-06 20:32:51', 0, 'N', 'Y', '0'),
(2127, NULL, NULL, 'House – It''s Quite Good, Really', '1992', 13, 'P', '<p>Written with BAPS (The Bazzasoft Adventure Programming System) which is also on TBI-189.</p>\r\n<p>Contained on the BAPS disc were "All the colours of darkness", "House - it''s quite good really", "Test of the turnip", and "Eridan rescue".</p>\r\n<p>Published on 8BS as part of the Jon Ripley Public Domain collection, on disc JJR-09, which, in fact contained 3 discs of adventure games. This adventure is on disc 3.</p>\r\n<p>Also given away on the BBC Subscribers disc in Acorn Computing (Formerly The Micro User Magazine) vol.12 issue 6 in August 1994.</p>\r\n<p>Published on the 8BS Public Domain disc TBI-189</p>\r\n<p>Later published on the Electron User Group PD Disc 53 in August 2000.</p>', 1, 1, NULL, 'D', NULL, NULL, NULL, NULL, NULL, 2, '2018-10-10 19:10:21', '0000-00-00 00:00:00', 0, '2017-05-06 20:32:54', 0, 'N', 'Y', '0'),
(2128, NULL, NULL, 'Battleships', '1993', 34, 'P', '<p>Published on the HeadFirst Public Domain Disc 10.</p>\r\n<p>Published on the 8BS Public Domain disc 26 in April 1993.</p>\r\n<p>Published on BBC PD Disc 157.</p>\r\n<p>An earlier version of this game (Version 3A) was published on GLM Public domain disc 02.</p>\r\n<p>Later published on the Electron User Group PD Disc 67 some time after 2002..</p>\r\n<p>&nbsp;</p>', 1, 1, NULL, NULL, NULL, NULL, 'V4.2', NULL, NULL, 2, '2018-10-11 08:24:17', '0000-00-00 00:00:00', 0, '2018-10-15 18:02:21', 2, 'N', 'Y', '0'),
