(2178, NULL, 'The', 'Orb', '1986', 13, 'R', '<p>The Orb was probably first mentioned in the Spring 1985 supplement to A&amp;B Computing magazine, and was advertised in the March 1986 issue.&nbsp;The game was sold on <a href="index.php?search=Adventure+Crazy+collection+no.2&amp;on_C=on&amp;sort=a">Adventure Crazy No. 2</a>, a collection of adventure games which comprised Death In Poglovia, Puss In Boots, Secret Agent, The Orb, Mysterious Yeti, and Diamond Adventure.</p>', 1, 1, NULL, NULL, NULL, NULL, '', '', NULL, 3, '2018-10-13 20:12:36', '0000-00-00 00:00:00', 0, '2018-08-29 08:56:16', 2, 'N', 'Y', '0'),
