(2191, NULL, NULL, 'Planetfall (AKA Planet Fall)', '1983', 36, 'R', '<p>This game was originally written for the Sharp MZ-80K computer by Tim Garden.</p>\r\n<p>It was translated for the BBC micro by Ian Nicholls.</p>\r\n<p>The game was commercially released for the beeb in 1983 and the listings for both the Sharp and the BBC micro were later printed in the August 1983 issue of Computing Today magazine.</p>', 2, 12, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 2, '2018-10-14 17:14:46', '0000-00-00 00:00:00', 0, '2017-11-12 16:15:58', 0, 'N', 'Y', '0'),
