(2242, NULL, NULL, 'Time Switch', '1983', 13, 'M', '<p>Published in Your Computer Magazine volume 3 issue 8 in August 1983. The listing was for the Sinclair Spectrum. <br />The game was ported to the BBC Micro in 1989 by Jon Ripley.</p>\r\n<p>Later published on 8BS as part of the Jon Ripley Public Domain collection, on disc JJR-09, which, in fact contained 3 discs of adventure games. This adventure is on disc 2.<br />Later published on the 8BS Public Domain disc 48 in March 1996.</p>\r\n<p>Published on 8BS as part of the Jon Ripley Public Domain collection, on disc JJR-09, which, in fact contained 3 discs of adventure games. This adventure is on disc 2.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-10-12 12:48:44', '0000-00-00 00:00:00', 0, '2017-05-06 20:35:44', 0, 'N', 'Y', '0'),
