(2250, NULL, 'The', 'Valley', '1983', 36, 'R', '<p>The BBC micro game is a conversion of "The Valley", written for the Commodore PET computer by Henry Budgett, Peter Freebrey, Peter Green, and Ron Harris. It was first published in the April 1982 issue of Computing Today magazine.</p>\r\n<p>The original, commercial BBC micro release by ASP software was in early 1983.</p>', 1, 1, NULL, 'T', NULL, NULL, NULL, NULL, NULL, 2, '2018-10-09 00:06:15', '0000-00-00 00:00:00', 0, '2017-05-06 20:35:52', 0, 'Y', 'Y', '0'),
