(2294, NULL, NULL, 'Ingrid''s Back Picture Disc (Gnome Ranger II)', '1988', 13, 'R', 'This disc contains the pictures for the adventure game <a href="http://bbcmicro.co.uk/game.php?id=2132">Ingrids Back</a>. It can''t be played online. To see the pictures, download this disc, and <a href="http://bbcmicro.co.uk/game.php?id=2132">Ingrids Back</a>, and once the adventure game has loaded swap this disc into the disc drive.', 1, 1, NULL, NULL, 'Graphics only shown on a Master, or BBC with 48K Ram minimum', NULL, NULL, 'Gnome Ranger', '2', 2, '2017-10-16 16:25:33', '0000-00-00 00:00:00', 0, '2017-05-06 20:33:01', 0, 'N', 'Y', NULL),
