(2296, NULL, NULL, 'Pop Quiz Master', '198x', 29, 'W', '<p>The game needs to write some configuration to the disc, and this isn''t possible in jsbeeb at present. To play, download the disc and play it in an emulator, but switch off the write protect first.</p><p>The discs below are additional questions. Both this and the database disc need to be in the drives .\r\n<ul>\r\n<li><a href="http://bbcmicro.co.uk/game.php?id=2297">Pop Quiz Master (Database Disc 1)</a></li>\r\n<li><a href="http://bbcmicro.co.uk/game.php?id=2298">Pop Quiz Master (Database Disc 2)</a></li>\r\n<li><a href="http://bbcmicro.co.uk/game.php?id=2299">Pop Quiz Master (Database Disc 3)</a></li>\r\n<li><a href="http://bbcmicro.co.uk/game.php?id=2300">Pop Quiz Master (Database Disc 4)</a></li>	\r\n</ul>\r\n</p>', 1, 2, NULL, NULL, NULL, NULL, NULL, 'Pop Quiz Master', NULL, 2, '2017-12-18 14:43:39', '0000-00-00 00:00:00', 0, '2017-05-06 20:34:18', 0, 'N', 'Y', '0'),
(2297, NULL, NULL, 'Pop Quiz Master (Database Disc 1)', '198x', 567, 'W', 'This is an additional database disc for the pop master quiz. The game doesn''t currently work because the disc is read only and the program writes configuration to disc before it starts the quiz. Hopefully jsbeeb can be modified to allow writing to images, but until then, the best way to run this disc is to download this disc image and the <a href="http://bbcmicro.co.uk/game.php?id=2296">Pop Quiz Master</a> disc, and run them in an emulator. <a href="http://bbcmicro.co.uk/game.php?id=2296">Pop Quiz Master</a> needs to be disc 1, and this disc needs to be disc 2 for the program to work properly.', 1, 2, NULL, NULL, NULL, NULL, NULL, 'Pop Quiz Master', 'Database Disc 1', 2, '2017-12-18 14:44:02', '0000-00-00 00:00:00', 0, '2017-05-06 20:34:19', 0, 'N', 'Y', '0'),
