(2335, NULL, NULL, 'Adventure', '1993', 13, 'P', '<p>Published on 8BS as part of the Jon Ripley Public Domain collection, on disc JJR-09, which, in fact contained 3 discs of adventure games. This adventure is on disc 2.</p>\r\n<p>Published on the Acorn User subscriber''s disc. in July 1993.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-01-29 17:11:23', '0000-00-00 00:00:00', 0, '2017-05-08 22:24:15', 0, 'N', 'Y', '0'),
(2336, NULL, NULL, 'Starship Adventure', '1983', 13, 'M', 'Published in the September/October 1983 issue of A&B Computing.', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2017-11-23 14:46:55', '0000-00-00 00:00:00', 0, '2017-05-06 20:35:25', 0, 'N', 'Y', NULL),
(2337, NULL, 'The', 'Opal Lily', '1984', 13, 'B', '<p>From the book <em>Intelligent Adventures for the Electron and BBC Microcomputers </em>by Noel Williams, published by McGraw Hill.</p>\r\n<p>** The game may be faulty.** &nbsp;More details <a href="https://stardot.org.uk/forums/viewtopic.php?f=9&amp;t=6770&amp;p=138107&amp;hilit=opal%20lily#p138107">at Stardot</a>.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 3, '2018-08-01 18:20:20', '0000-00-00 00:00:00', 0, '2018-08-01 18:11:10', 3, 'N', 'Y', '0'),
(2338, NULL, NULL, 'Rendezvous', '1984', 13, 'B', '<p><em>Rendezvous</em> may be found as a type-in listing in <em>Computer Spy Games</em>, a free PDF of this book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>\r\n<p>As well as the listing the book contains a map showing all of the places you can visit, and it also lists all of the words you can use in the game.</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-01-19 14:52:11', '0000-00-00 00:00:00', 0, '2017-05-06 20:34:51', 0, 'N', 'Y', '0'),
(2339, NULL, NULL, 'Micro Puzzle (AKA Micropuzzle)', '1984', 13, 'B', '<p><em>Micro Puzzle</em> (or <em>Micropuzzle</em>, the book uses both titles) may be found as a type-in listing in <em>Weird Computer Games</em>, a free PDF of this book is available for download from <a href="https://usborne.com/browse-books/features/computer-and-coding-books/">Usborne Publishing</a> (scroll to near the bottom of the page).</p>', 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2018-01-19 14:48:25', '0000-00-00 00:00:00', 0, '2017-05-06 20:33:40', 0, 'N', 'Y', '0'),
(2340, NULL, 'The', 'Darkness Of Raven Wood', '2017', 13, 'P', '<p><em>Your childhood friend Raynard writes to tell you that weird things are happening near the village where you grew up: <a href="https://www.google.com/search?q=eldritch+meaning">eldritch</a> storms rage,&nbsp;</em><em>children are missing,&nbsp;</em><em>and unholy creatures stalk the earth... Now Raynard too has vanished! Who or what is behind these strange goings-on? Are you brave enough to solve the mystery that lies deep within The Darkness of Raven Wood?&nbsp;</em></p>\r\n<p>More details at <a href="http://johnblythe5.wixsite.com/rucksackgames">Rucksack Games</a>.&nbsp;</p>', 1, 1, NULL, 'D', NULL, NULL, 'V1.3', NULL, NULL, 2, '2018-11-10 11:18:41', '0000-00-00 00:00:00', 0, '2018-08-29 08:53:22', 2, 'N', 'Y', 'Y'),
