(2344, NULL, '', 'Jon Ripley''s Mini-Adventure Games (Enchanted Castle, Quest For The Holy Grail, Graveyard Escape, House, Prison, Secret Maze, Secret Maze II, Shack)', '1995', 13, 'U', '<p>These eight games were demos of Jon Ripley''s <a href="http://jonripley.com/i-fiction/games/MiniAdvR.html">Mini-Adventure</a> interactive fiction authoring system.&nbsp;The games and the system itself were never officially released.</p>\r\n<p>All of the games are copyright (c) Jon Ripley 1995, except Secret Maze II, which is copyright (c) Jon Ripley 1996.</p>', 1, 1, NULL, '', NULL, NULL, NULL, NULL, NULL, 3, '2018-09-06 15:18:42', '0000-00-00 00:00:00', 0, '2018-09-06 13:00:52', 3, 'N', 'Y', '0'),
(2345, 14, NULL, 'Snapper (AKA Pac-Man) (AKA Pacman)', '1982', 1, 'R', '<p>Acornsoft had to withdraw this title after complaints from the copyright holder. It was quickly re-released with <a href="game.php?id=14">different graphics</a></p>\r\n<p>Snapper is a clone of the 1980 arcade game&nbsp;<a href="https://www.youtube.com/watch?v=dScq4P5gn4A">Pac-Man</a> from Namco.</p>', 1, 1, NULL, NULL, NULL, NULL, 'Version 1', NULL, NULL, 2, '2018-08-11 14:16:02', '0000-00-00 00:00:00', 0, '2017-05-06 20:36:23', 0, 'N', 'Y', '0'),
(2346, NULL, NULL, 'Scapeghost Picture Disc', '1989', 13, 'R', '<p>This disc contains the pictures for the adventure game <a href="http://bbcmicro.co.uk/game.php?id=2554">Scapeghost</a>. It can''t be played online. To see the pictures, download this disc, and <a href="http://bbcmicro.co.uk/game.php?id=2554">Scapeghost</a>, and once the adventure game has loaded swap this disc into the disc drive.</p>', 1, 1, NULL, 'D', 'Graphics only shown on a Master, or BBC with 48K Ram minimum', NULL, NULL, NULL, NULL, 2, '2017-10-17 08:52:48', '0000-00-00 00:00:00', 0, '2017-10-15 17:10:27', 0, 'N', 'Y', NULL),
(2347, NULL, 'The', 'Krystal Connection', '2009', 4, 'R', 'This game is not available for download or playable online as it is a new commercial release. See <a href=''http://www.retrosoftware.co.uk/wiki/index.php?title=The_Krystal_Connection''>Retro Software</a> for more information.', 1, 1, '', '', '', '', '', '', '', 2, '2017-10-23 11:40:12', '0000-00-00 00:00:00', 0, NULL, 0, 'N', 'Y', NULL),
