(2757, NULL, NULL, 'Acorn User Games Disc', '1988', 599, 'R', '<p>This disc was first advertised for sale in Acorn User magazine in October 1988.</p>\r\n<p>It consists of previously published Acorn User games:&nbsp;<a href="game.php?id=2254">Warlord</a> (Peter Voke), <a href="game.php?id=738">Wizalon</a> (David Lawton), <a href="game.php?id=391">Run Silent, Run Deep</a> (Phil Martin), <a href="game.php?id=1207">Castle of Nightmares</a> (Mark de Weger), <a href="game.php?id=1077">Quadline</a> (David Acton), <a href="game.php?id=2737">3D Pentominoes (AKA Polyominoes)</a> (David Lawrence/Don Scales), <a href="game.php?id=2718">Race to Varpon</a> (Oscar Rune), <a href="game.php?id=1486">Maze</a> (David Lawrence), Mastermind (Orson Fact), and&nbsp;<a href="game.php?id=2718">Lurch</a> (Stan Froco).</p>\r\n<p>Orson Fact is a made-up name. It is an anagram of Stan Froco.</p>\r\n<p>All of the <a href="http://bbcmicro.co.uk/game.php?id=2718">one-line games</a> previously appeared in the Acorn User "Acorn Abuser''s Diary" section, but at the time of writing it is not known which issue (if any), the Mastermind game was published.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-16 08:51:28', '2018-01-30 12:28:38', 2, '2018-02-12 12:54:45', 2, 'N', 'Y', '0'),
