(2785, NULL, NULL, 'Christmas Crackers', '1983', 599, 'R', '<p>First advertised for sale in Micro User magazine (volume 1, issue 9) in November 1983. Note that Micro User used the "Christmas Crackers" name again, for <a href="game.php?id=2717">a different compilation</a> released in 1986 and again in 1987.</p>\r\n<p>The 1983 compilation comprised Sleigh Lander, Christmas Simon, Anagrams, Ski Slope, Carol Quiz, Tic-Tac-Toe, Collect The Trees, Maze Pud, Snow Pud, Chimes, Christmas Word Search, Dodge Dad, Mover, Christmas Keyboard Tester, Blind-Man''s Buff, Forest Run, Halves, Turkey Shoot, Crazy Santa, Christmas Snap, and Santa Skittle.</p>\r\n<p><a href="game.php?id=2717">The 1986 compilation</a> comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-29 15:05:01', '2018-02-09 14:19:22', 2, '2018-02-09 14:46:19', 2, 'N', 'Y', '0'),
(2786, NULL, NULL, 'Air Traffic Control Simulator', '1983', 8, 'R', '<p>Published on "Beebtape 4". This was number 4 in a series of 6 "Beebtapes" - compilation tapes that CLS Microdata released in 1982 and 1983.</p>', 1, 1, '', '', '', '', '', 'Beebtape', '4', 2, '2018-02-12 12:19:13', '2018-02-12 12:16:59', 2, '2018-02-19 10:11:37', 2, 'N', 'Y', '0'),
