(2831, 1423, NULL, '3D Noughts & Crosses', '1982', 34, 'M', '<p>This is an early V1 version.</p>\r\n<p>Published in Beebug Magazine volume 1 issue 1 in April 1982. <br />Also sold by Beebugsoft along with Moon Lander as "Games 2". First advertised in volume 1 issue 4, although it may have been advertised on a seperate leaflet slightly earlier. <br />Published on the Elbug Magazine introductory cassette in 1983. <br />First advertised in Elbug volume 1 issue 1, but available via the Orbit user Group before this.</p>', 1, 2, '', '', '', '', 'V1', '', '', 2, '2018-03-08 12:59:27', '2018-03-07 11:30:04', 2, '2018-03-07 21:34:20', 2, 'N', 'Y', '0'),
(2832, 1158, NULL, 'City Bomber', '1991', 2, 'P', '<p>This is an alternative version of the game, that features a different loading screen.</p>\r\n<p>Published on the 8BS Public Domain disc 09 in February 1991. <br />Also published on the Micro User Magazine subscribers disc vol.10 issue 1 in March 1992. (Credited to JJF PD).</p>\r\n<p>Published on the BBC PD Disc 15.</p>\r\n<p>Later published on the Electron User Group PD Disc 45 in September 1999.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-12 09:35:46', '2018-03-07 11:30:21', 2, '2018-03-07 21:34:43', 2, 'N', 'Y', '0'),
(2833, 478, NULL, 'Evil Invaders [hack] (AKA IJK Invaders)', '2000', 454, 'L', '<p>This is a modified version of IJK Software''s Model B version of&nbsp;<a href="game.php?id=478">IJK Invaders</a> Originally written by P.B. Cridland, and modified by D.G. Bearsmore in the year 2000.</p>\r\n<p><span style="color: #333333; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 14px;">Published on the 8BS Public Domain disc TBI-178</span></p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-06-19 16:10:10', '2018-03-07 11:30:38', 2, '2018-03-07 21:35:02', 2, 'N', 'Y', '0'),
(2834, 10, NULL, 'Monstas - The Upgrade For Monsters [hack]', '1984', 4, 'L', '<p>Extra levels and extra features for the classic <a href="game.php?id=10">Monsters</a></p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-01 18:12:47', '2018-03-07 11:30:57', 2, '2018-03-07 21:35:25', 2, 'N', 'Y', '0'),
(2835, 45, NULL, 'Moon Raider', '1983', 3, 'R', '<p>This is the Electron version of the game, that has a different screen layout to the BBC Micro version.</p>', 1, 1, '', '', '', 'Y', '', '', '', 2, '2018-03-08 13:00:48', '2018-03-07 11:31:17', 2, '2018-03-07 21:35:45', 2, 'N', 'Y', '0'),
(2836, 1828, NULL, 'Mr. Miner', '1987', 466, 'L', '<p>This is a re-coded, faster version of&nbsp;<a href="game.php?id=1828">Mr. Miner</a> that was originally published in Electron User magazine volume 4, issue 12 in September 1987.</p>\r\n<p>Re-coded by Richard Dimond, and published on the Electron User Group PD Disc 23 in December 1995.</p>', 1, 1, '', 'D', '', 'Y', '', '', '', 2, '2018-10-10 22:36:33', '2018-03-07 11:31:31', 2, '2018-09-13 09:13:42', 2, 'N', 'Y', '0'),
(2837, 4, NULL, 'Painter [pre-release] (AKA Demon Decorator)', '1983', 1, 'U', '<p>This is a pre-release version of the game. It was released as <a href="game.php?id=4">Demon Decorator</a></p>', 1, 1, '', '', '', '', 'Pre-Release', '', '', 2, '2018-06-18 11:53:05', '2018-03-07 11:31:56', 2, '2018-08-17 14:19:23', 2, 'N', 'Y', '0'),
(2838, 576, 'The', 'Train Game ''91', '1991', 21, 'M', '<p>This is an updated, completely re-written version of the original Train Game by Peter Balch, that was published in the January 1984 issue of Acorn User.</p>\r\n<p>This new updated version was written by Dave Lawrence, and was published in the October 1991 issue.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-03-07 21:17:32', '2018-03-07 11:32:25', 2, '2018-03-07 21:37:27', 2, 'N', 'Y', '0'),
(2839, 1815, NULL, 'U.S. Invaders (AKA US Invaders) (AKA U.S.S. Endeavour) (AKA USS Endeavour)', '1986', 454, 'L', '<p>This is an alternative version of&nbsp;<a href="game.php?id=1815">U.S.S. Endeavour</a> which was published in Micro User Magazine vol.3 issue 12 in February 1986</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-06-19 16:21:18', '2018-03-07 11:32:53', 2, '2018-03-07 21:37:57', 2, 'N', 'Y', '0'),
(2840, 759, NULL, 'Wall ''Em In (AKA Brick ''Em In)', '1982', 1, 'R', '<p>This is an alternative version of "Brick ''Em In" from Software For All.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-03-08 12:57:39', '2018-03-07 11:33:25', 2, '2018-03-07 21:38:16', 2, 'N', 'Y', '0'),
(2841, 290, NULL, 'Citadel Item Randomiser', '2018', 5, 'L', '<p>Randomises the locations of objects in the game, to breathe more life into the classic <a href="game.php?id=290">Citadel</a>.</p>\r\n<p><a href="http://www.stardot.org.uk/forums/viewtopic.php?f=1&amp;t=14318">More details</a> at Stardot.</p>', 1, 1, 'O', '', '', '', '', '', '', 3, '2018-09-23 14:55:14', '2018-03-11 23:39:41', 3, '2018-08-29 08:52:48', 2, 'N', 'Y', '0'),
(2842, NULL, NULL, 'Sugar Smash', '2016', 17, 'P', '<p><em>"A BBC Micro game in the confection destruction tradition, released at Sundown 2016."</em></p>\r\n<p><a href="http://crtc.tv">More details</a> at CRTC.</p>\r\n<p>&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-03-31 14:56:55', '2018-03-31 02:43:13', 3, '2018-08-29 08:56:59', 2, 'N', 'N', 'Y'),
(2843, NULL, NULL, 'Prince of Persia', '2018', 5, 'P', '<p><a href="https://en.wikipedia.org/wiki/Prince_of_Persia">Prince of Persia</a> was originally created in the 1980s by Jordan Mechner for the Apple II, with music composed by Francis Mechner.</p>\r\n<p>The game was ported to the BBC Master in 2018 by Kieran Connell et al.</p>\r\n<p><a href="https://bitshifters.github.io/posts/prods/bs-pop-beeb.html">More details</a> at Bitshifters.</p>\r\n<p>&nbsp;</p>', 1, 1, '', 'D', '', '', '', '', '', 3, '2018-04-01 12:51:25', '2018-03-31 15:06:02', 3, '2018-08-29 08:56:35', 2, 'N', 'N', 'Y'),
(2844, NULL, NULL, 'Magic Castle', '2012', 13, 'P', '<p>Originally written by Graeme Yeandle, and published for the Sinclair Spectrum by Gilsoft International in 1983.</p>\r\n<p>Ported to the BBC Micro in 2012 by Andy Ford, and published by Retro Software.</p>\r\n<p>More info <a href="https://solutionarchive.com/game/id%2C342/Magic+Castle.html">here</a> and <a href="http://stardot.org.uk/forums/viewtopic.php?f=32&amp;t=5318">here.</a></p>', 1, 1, '', 'T', '', '', '', '', '', 2, '2018-04-01 12:34:15', '2018-04-01 12:23:09', 2, '2018-04-01 12:32:57', 2, 'N', 'Y', '0'),
(2845, NULL, NULL, 'Subsunk', '2012', 13, 'P', '<p>Originally written by Peter Torrance and C. Liddle, and published for the Sinclair Spectrum by Firebird Software in 1985.</p>\r\n<p>Ported to the BBC Micro in 2012 by Andy Ford, and published by Retro Software.</p>\r\n<p>More info <a href="https://solutionarchive.com/game/id%2C524/Subsunk.html">here</a> and <a href="http://stardot.org.uk/forums/viewtopic.php?f=32&amp;t=5288">here.</a></p>', 1, 1, '', 'T', '', '', '', '', '', 2, '2018-04-01 13:01:24', '2018-04-01 12:37:27', 2, '2018-04-01 12:46:33', 2, 'N', 'Y', '0'),
(2846, NULL, '', 'Maze Of Madness', '2018', 13, 'P', '<p>A solvable demo of a very cruel puzzle idea.</p>\r\n<p>More details <a href="http://solutionarchive.com/game/id%2C7659/Maze+of+Madness.html">at CASA</a>, <a href="http://www.stardot.org.uk/forums/viewtopic.php?f=57&amp;t=14871&amp;p=199409#p199364">at Stardot</a>, at <a href="https://ahopeful.wordpress.com/2018/04/24/maze-of-madness-2018-a-torment/">Retroactive Fiction</a>, and at <a href="http://ifdb.tads.org/viewgame?id=qffy5phbtkpgxkia">IFDB</a>.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-04-29 11:48:42', '2018-04-16 22:08:10', 3, '2018-08-29 08:55:33', 2, 'N', 'Y', '0'),
