(2848, NULL, '', 'Eternity', '2000', 17, 'P', '<p>Based on the <a href="https://en.m.wikipedia.org/wiki/Eternity_puzzle">Eternity</a>&nbsp;puzzle of the same name. Famous for its million pound prize give-away.</p>\r\n<p>Published on the Electron User Group PD Disc 55 in December 2000.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-10 19:03:05', '2018-04-18 09:34:18', 2, '2018-08-13 10:23:21', 2, 'N', 'Y', '0'),
