(2873, 2874, '', 'Bat ''n'' Ball', '1981', 18, 'R', '<p>This game appeared on the <a href="game.php?id=2874">Welcome tape</a> for the BBC Micro.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-06-25 16:01:03', '2018-06-25 14:19:31', 2, '2018-06-25 14:20:51', 2, 'Y', 'Y', '0'),
(2874, NULL, '', 'Welcome Tape / Welcome Disc', '1981', 599, 'R', '<p>This is the disc version of the Welcome package that came with the BBC Micro.</p>\r\n<p>It is a collection of simple utility programs and games, which show different aspects of the computer.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-06-25 16:03:07', '2018-06-25 14:39:06', 2, '2018-08-29 08:57:23', 2, 'Y', 'Y', '0'),
(2875, 2874, '', 'Adventure (BBC Master Welcome Disc)', '1986', 13, 'R', '<p>This adventure appeared on the Welcome tape/disc for the BBC Master 128.</p>\r\n<p>It has been altered to run in Mode 7 so it will work on a standard BBC Model B as well as the Master.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-06-25 22:06:16', '2018-06-25 14:55:55', 2, '2018-06-25 14:56:47', 2, 'N', 'Y', 'Y'),
(2876, NULL, '', 'Wallaby Wrestling Federation', '1992', 569, 'P', '<p>Published on BBC PD Games #9.</p>\r\n<p>Published on BBC PD Disc 117.</p>\r\n<p>Later published on the Electron User Group PD Disc 34 in October 1997.</p>', 2, 6, '', '', '', '', '', '', '', 2, '2018-10-11 17:20:07', '2018-06-29 13:26:15', 2, '2018-06-29 13:27:07', 2, 'N', 'Y', '0'),
(2877, NULL, '', 'Quadrix', '1990', 17, 'P', '<p>Published on BBC PD Games #6.</p>\r\n<p>Later published on the Electron User Group PD Disc 47 in January 2000.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-11 08:45:24', '2018-06-29 13:29:59', 2, '2018-10-15 18:02:02', 2, 'N', 'Y', '0'),
(2878, NULL, '', 'Supermarket', '1983', 21, 'R', '', 1, 2, '', '', '', '', '', '', '', 2, '2018-06-29 13:32:58', '2018-06-29 13:32:09', 2, '2018-06-29 13:34:42', 2, 'N', 'Y', '0'),
(2879, NULL, '', 'Beebug One-Line Games (Asterisk Tracker, a Truffle Hunt clone, and a treasure hunt)', '1984', 569, 'M', '<p>These three one-line games were published in issue 7, volume 3, of Beebug magazine in December 1984. The source-code for each game consists of a single line of (<a href="https://archive.org/stream/BBCUG/BBCMUG#page/n485/mode/2up">abbreviated</a>) BBC BASIC.</p>\r\n<p>More details <a href="https://stardot.org.uk/forums/viewtopic.php?f=2&amp;t=15319#p207744">at Stardot</a>.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-07-06 10:32:15', '2018-07-05 23:12:52', 3, '2018-08-29 08:52:27', 2, 'Y', 'Y', '0'),
(2880, NULL, '', 'Bee Beater (AKA Beebeater) (AKA Gobble The Goodies)', '1983', 1, 'R', '', 1, 1, 'O', '', '', '', '', '', '', 2, '2018-08-29 20:49:55', '2018-07-27 18:47:26', 3, '2018-08-29 08:52:05', 2, 'N', 'Y', '0'),
(2881, NULL, '', 'One Room (AKA Oneroom)', '1983', 13, 'B', '<p>One Room might be the first room-escape game. It might even be the first one-room text adventure game. What''s certain is that it''s a text adventure game written in 32K Extended Color BASIC for the TRS-80 Color Computer and published in the <a href="https://archive.org/stream/RainbowBookAdventures/Rainbow%20Book%20Adventures#page/n59/mode/2up">Rainbow Book Of Adventures</a> in 1983.&nbsp;</p>\r\n<p>The game was ported to BBC BASIC for the BBC Micro computer in 2018.</p>\r\n<p>More details&nbsp;<a href="https://www.youtube.com/watch?v=FuJQqBVZGnw">on YouTube</a>, <a href="https://ahopeful.wordpress.com/2018/08/10/one-room-1983-the-first-one-room-game/">at Retroactive Fiction</a>,&nbsp;<a href="https://stardot.org.uk/forums/viewtopic.php?f=40&amp;t=15340&amp;p=208505&amp;hilit=one%20room#p208505">at Stardot</a>, <a href="http://ifdb.tads.org/viewgame?id=8mby8zffji4ah3di">at IFDB</a>,&nbsp;<a href="http://solutionarchive.com/game/id%2C7761/One+Room.html">at CASA</a>, and&nbsp;<a href="https://www.intfiction.org/forum/viewtopic.php?f=4&amp;t=26431#p142646">at IntFiction.org</a>.&nbsp;</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-08-18 15:54:18', '2018-08-10 17:08:10', 3, '2018-08-29 08:55:53', 2, 'N', 'Y', 'Y'),
(2882, 96, '', 'Frak!', '1986', 4, 'R', '<p>This is the original Acorn Electron version of Frak from Aardvark Software.</p>', 1, 1, '', 'T', '', 'Y', 'V2.1', '', '', 2, '2018-09-11 16:03:32', '2018-08-26 10:19:44', 2, '2018-09-13 15:29:05', 2, 'N', 'Y', '0');
INSERT INTO `games` (`id`, `parent`, `title_article`, `title`, `year`, `genre`, `reltype`, `notes`, `players_min`, `players_max`, `joystick`, `save`, `hardware`, `electron`, `version`, `series`, `series_no`, `lastupdater`, `lastupdated`, `created`, `creator`, `imgupdated`, `imgupdater`, `compat_a`, `compat_b`, `compat_master`) VALUES
(2883, NULL, '', 'Lighthouse Adventure', '1983', 13, 'B', '<p>Lighthouse adventure is a text adventure game written in BASIC for the TRS-80 Color Computer. It was published in the <a href="https://archive.org/stream/RainbowBookAdventures/Rainbow%20Book%20Adventures#page/n23/mode/2up">Rainbow Book Of Adventures</a> in 1983.&nbsp;</p>\r\n<p>The game was <a href="https://stardot.org.uk/forums/viewtopic.php?f=40&amp;t=15340&amp;p=213068#p212560">ported</a> to BBC BASIC for the BBC Micro computer in 2018.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-08-31 01:49:25', '2018-08-27 11:25:02', 2, '2018-08-27 11:27:21', 2, 'N', 'Y', '0'),
(2884, NULL, '', 'Tea Shop', '1983', 496, 'W', '', 1, 4, '', '', '', '', '', '', '', 2, '2018-08-30 22:06:59', '2018-08-30 21:28:40', 2, '2018-08-30 21:30:52', 2, 'N', 'Y', '0'),
(2885, NULL, '', '8-Bit Software One-Line Games', '1993', 569, 'P', '<p>All of these games appeared on 8-Bit Software in 1993-1994.</p>\r\n<p>The original date of the various programs are not known.</p>\r\n<p>Game No. 1 "Short" also appeared on the Acorn Computing coverdisc for vol. 11 issue 7 in September 1993.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-09-26 08:37:23', '2018-08-31 13:36:21', 2, '2018-08-31 13:39:09', 2, 'N', 'Y', '0'),
(2886, NULL, '', 'Space Grab', '2016', 11, 'P', '<p>According to in-game text, &nbsp;the game was inspired by "Fast Food" on the Atari 2600.</p>', 1, 1, '', '', '', 'Y', '', '', '', 2, '2018-09-03 18:35:54', '2018-09-03 17:34:16', 2, '2018-09-03 17:35:08', 2, 'N', 'Y', '0'),
(2887, NULL, '', 'Under The Mortuary', '1986', 5, 'M', '<p>Published over four issues of Popular Computing Weekly magazine: volume 5, issues 6, 7, 8, and 9 (February 6th, 13th, 20th, and 27th, 1986).</p>\r\n<p>In <a href="https://www.linkedin.com/in/suniljagota/">his LinkedIn profile</a>, the author Sunil Jagota says, "I wrote my first flight simulator at the age of 14 and had written and published my first arcade adventure game written in 6502 machine code by the time I was 15. I am still just as passionate about technology as I was then."</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-09-05 19:13:10', '2018-09-03 17:34:28', 2, '2018-09-03 17:36:06', 2, 'N', 'Y', 'N'),
(2888, NULL, '', 'Demo Adventure (From The Computer & Video Games Book Of Adventure)', '1983', 13, 'B', '<p>This listing is found in "The Computer &amp; Video Games Book of Adventure" published by Melbourne House in 1983.</p>\r\n<p>The original listing was buggy. This version has been fixed.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-09-04 13:26:49', '2018-09-04 13:25:00', 2, '2018-09-04 13:25:51', 2, 'N', 'Y', '0'),
(2889, NULL, '', 'Fives & Threes (AKA Fives And Threes)', '1993', 499, 'M', '<p>Given away on the BBC Subscribers disc in Acorn Computing (Formerly The Micro User Magazine) vol.11 issue 5 in July 1993.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-09-05 17:02:34', '2018-09-05 16:56:21', 2, '2018-09-05 17:03:08', 2, 'N', 'Y', '0'),
(2890, NULL, '', 'Model B Crossword 2', '1985', 17, 'M', '<p>Published on the "Model B Computing" cassette number 10 in April/May 1985.</p>', 1, 1, '', 'D', '', '', '', '', '', 2, '2018-09-05 17:15:28', '2018-09-05 17:15:28', 2, '2018-09-05 17:16:00', 2, 'N', 'Y', NULL),
