(2892, NULL, '', 'Solitaire And Solve', '1988', 498, 'M', '<p>Published in Beebug Magazine volume 7 issue 3 in July 1988.</p>', 1, 1, '', '', '', '', 'VB0.56', '', '', 2, '2018-09-05 18:57:56', '2018-09-05 18:56:02', 2, '2018-09-05 18:59:03', 2, 'N', 'Y', '0'),
(2893, NULL, '', 'Space Station', '1984', 569, 'M', '<p>Published in issue 5 of Input magazine. Page 144.</p>\r\n<p>As it stands, the game isn''t really complete &mdash; no timing or scoring has been added.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-09-05 19:06:29', '2018-09-05 19:06:29', 2, '2018-09-05 19:07:31', 2, 'N', 'Y', NULL),
(2894, NULL, '', 'Which-Way', '1984', 31, 'R', '<p>Published on the Micro User "Golden Games" compilation in 1984. The compilation consisted of Bill Bounces Back, Cribbage, Fair Play, Sevens, Which Way, White Widow, Yams, China Drop, Crown Green Bowls, Draw Poker, Explorer Eddie, Master Spy, Patience, and Splat!</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-09-05 19:37:58', '2018-09-05 19:34:00', 2, '2018-09-05 19:34:57', 2, 'N', 'Y', '0'),
(2895, NULL, '', 'Frak! [hack]', '1989', 4, 'L', '<p>This is a modification of the original Acorn Electron version of Aardvark Software''s Frak.&nbsp;This hack from 1989 gives the player many ways to cheat!&nbsp;The cheats come from the commercially available "Cheat It Again Joe 4" cheats disc, sold by Zentrix Software. (The first 3 "Cheat It Again Joe" cheat compilations were published by Impact Software.) All the "Cheat It Again Joe" tapes and discs were the brainchild of Mark Gidley.</p>', 1, 1, '', 'T', '', 'Y', '', '', '', 2, '2018-09-15 20:08:29', '2018-09-11 16:03:06', 2, '2018-09-13 15:26:00', 2, 'N', 'Y', '0'),
(2896, NULL, '', 'Silverton House', '1985', 13, 'B', '<p>Lighthouse adventure is a text adventure game written in BASIC for the TRS-80 Color Computer. It was published in the <a href="https://archive.org/stream/secondrainbowboo00char#page/n219">Second Rainbow Book Of Adventures</a> in 1985.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>The game was <a href="https://stardot.org.uk/forums/viewtopic.php?f=40&amp;t=15666&amp;p=214278&amp;hilit=silverton#p214278">ported</a> to BBC BASIC for the BBC Micro computer in 2018.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-09-12 17:54:02', '2018-09-12 17:53:08', 2, '2018-09-12 17:57:57', 2, 'N', 'Y', '0'),
(2897, NULL, '', 'Mystery Of The Java Star', '1984', 13, 'R', '<p>See EveryGameGoing.com for&nbsp;<a href="http://www.everygamegoing.com/egg/landingItem/index/machine_type_group_default_folder/electron/publisher_folder/shards/format_folder/tapes/item_title/Mystery-Of-The-Java-Star">instructions and more</a>.</p>\r\n<p>Mystery Of The Java Star is only compatible with machines that have PAGE set at &amp;E00, such as a BBC Master 128.</p>\r\n<p>(The game was originally released on <em>cassette-tape</em> for the BBC Micro Model B but it can''t easily be run from <em>floppy disc</em> with a standard Model B. <a href="https://stardot.org.uk/forums/viewtopic.php?f=1&amp;t=15714&amp;p=215389#p215251">More details</a> at Stardot.)</p>', 1, 1, '', 'D', '', '', '', '', '', 3, '2018-10-13 20:18:00', '2018-09-24 09:45:18', 2, '2018-10-12 20:54:36', 1, 'N', 'N', 'Y'),
