(2927, NULL, '', 'Duck Shoot', '1985', 2, 'M', '<p>Published in issue 16 of Input magazine. Page 492.</p>', 1, 1, 'R', '', '', '', '', '', '', 2, '2018-10-06 11:14:30', '2018-10-06 11:13:28', 2, '2018-10-06 11:15:19', 2, 'N', 'Y', '0'),
(2928, 2054, '', 'Cells And Serpents (Improved)', '1991', 36, 'L', '<p>This game is the improved modification of the 1983 original release.</p>\r\n<p>The BBC micro game is a conversion of "Cells And Serpents", written for the NASCOM computer by G. Lovell, first published in the December 1980 issue of Computing Today magazine.</p>\r\n<p>&nbsp;</p>\r\n<p>The original, commercial BBC micro release by ASP software was in early 1983. A functionally identical, but much better annotated listing was published in the May/June 1983 issue of A&amp;B Computing (volume 1, issue 1) which credits I.G. Nicholls with the translation.<br />Later, a slightly different listing was published both on the 8BS Public Domain disc 05 in September 1990, and BBC PD Disc 10.<br />An improved version of this listing was published on both BBC PD Disc 166 (which featured Mad Rabbit PD Disc 024) and 8BS Public Domain disc 08 in January 1991 which credits the improvements to Roger Pashby in October 1990.</p>', 1, 1, '', 'D', '', '', '', '', '', 2, '2018-10-09 15:14:32', '2018-10-09 15:12:43', 2, '2018-10-09 15:15:42', 2, 'N', 'Y', '0'),
(2929, NULL, '', 'Air Sea Battle (AKA Sea Battle)', '1982', 2, 'M', '<p>Published in Your Computer Magazine volume 2 issue 7 in July 1982.</p>\r\n<p>The original magazine listing was buggy, and although the author sent in a fix to the September 1982 issue, the game still did not work properly.</p>\r\n<p>The game seen here is a close approximation of the author''s intentions.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-16 08:52:22', '2018-10-11 18:44:27', 2, '2018-10-11 18:46:50', 2, 'Y', 'Y', '0'),
(2930, NULL, '', 'Blitz', '1982', 2, 'M', '<p>Published in Beebon Newsletter/Magazine issue 1 in May 1982</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-11 18:57:13', '2018-10-11 18:54:56', 2, '2018-10-11 18:57:46', 2, 'N', 'Y', '0'),
(2931, NULL, '', 'Interplanetary Miner', '1984', 21, 'M', '<p>Published in Games Computing magazine, issue 11, November 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-11 19:13:47', '2018-10-11 19:01:26', 2, '2018-10-11 19:02:09', 2, 'N', 'Y', '0'),
(2932, 2717, '', 'Pull The Cracker', '1986', 342, 'R', '<p>Part of <a href="http://bbcmicro.co.uk/game.php?id=2717">Christmas Crackers</a></p>\r\n<p>First advertised for sale in Micro User magazine (volume 4, issue 10) in December 1986.&nbsp;Note that Micro User had used the "Christmas Crackers" name before, for <a href="game.php?id=2785">a different compilation</a> first released in 1983.</p>\r\n<p>The 1986 compilation comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-10-29 15:17:24', '2018-10-11 19:15:11', 2, '2018-10-11 19:17:10', 2, 'N', 'Y', '0'),
(2933, NULL, '', 'Rising Damp', '1984', 10, 'M', '<p>Published in Acorn Programs magazine June/July 1984. Issue 4.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-11 19:21:53', '2018-10-11 19:18:32', 2, '2018-10-11 19:31:37', 2, 'N', 'Y', '0'),
(2934, 2785, '', 'Snow Pud', '1983', 1, 'R', '<p>Part of <a href="game.php?id=2785">Christmas Crackers</a></p>\r\n<p>First advertised for sale in Micro User magazine (volume 1, issue 9) in November 1983. Note that Micro User used the "Christmas Crackers" name again, for <a href="game.php?id=2717">a different compilation</a> released in 1986 and again in 1987.</p>\r\n<p>&nbsp;</p>\r\n<p>The 1983 compilation comprised Sleigh Lander, Christmas Simon, Anagrams, Ski Slope, Carol Quiz, Tic-Tac-Toe, Collect The Trees, Maze Pud, Snow Pud, Chimes, Christmas Word Search, Dodge Dad, Mover, Christmas Keyboard Tester, Blind-Man''s Buff, Forest Run, Halves, Turkey Shoot, Crazy Santa, Christmas Snap, and Santa Skittle.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="game.php?id=2717">The 1986 compilation</a> comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-29 15:05:23', '2018-10-11 19:33:02', 2, '2018-10-11 19:37:08', 2, 'N', 'Y', '0'),
(2935, NULL, '', 'Lemonade Stall (AKA Lemonade Stand)', '1987', 496, 'M', '<p>Lemonade Stand is a business simulation game created for "<a href="https://en.wikipedia.org/wiki/Lemonade_Stand#Development">time-shared mainframe computers</a>" in 1973 by Bob Jamison of the Minnesota Educational Computing Consortium (MECC). In 1979 the game was ported to the Apple II by Charlie Kellner.&nbsp;Apple included the game with their computers throughout the 1980s. Kellner''s source code was released and the game has since been ported to modern computers as a free, open-source game.</p>\r\n<p>The Electron and BBC Micro version was published in Electron User magazine, volume 4, issue 12, in September 1987.</p>\r\n<p>The Apple II and the BBC Micro versions have not been compared, so it is not known whether Mark Smiddy ported the Apple II version, or simply wrote his own interpretation of the game.</p>', 1, 1, '', '', '', '', '', '', '', 3, '2018-10-16 12:10:23', '2018-10-15 09:44:59', 2, '2018-10-15 09:45:50', 2, 'N', 'Y', '0'),
(2936, 2904, '', 'Scramble (BeebEm version)', '2018', 3, 'P', '<p>To download and play in BeebEm, choose this version. Otherwise (Including real hardware or b-em), choose the main version - click the link below.</p>', 1, 1, '', '', '', '', '', '', '', 1, '2018-10-24 22:58:57', '2018-10-24 20:38:38', 1, '2018-10-24 20:44:00', 1, 'N', 'Y', 'Y'),
(2937, NULL, '', 'Luna Lander', '1982', 569, 'M', '<p>Published in Your Computer Magazine volume 2 issue 6 in June 1982.</p>\r\n<p>This was the first BBC Micro game published in Your Computer magazine.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-29 14:42:19', '2018-10-29 13:56:26', 2, '2018-10-29 14:05:08', 2, 'Y', 'Y', '0'),
(2938, NULL, '', 'Artillery Duel', '1983', 546, 'M', '<p>Published in Beebug Magazine volume 1 issue 10 in March 1983.</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-10-29 14:12:50', '2018-10-29 14:07:20', 2, '2018-10-29 14:12:32', 2, 'N', 'Y', '0'),
(2939, 2785, '', 'Collect The Trees', '1983', 1, 'R', '<p>Part of <a href="game.php?id=2785">Christmas Crackers</a></p>\r\n<p>First advertised for sale in Micro User magazine (volume 1, issue 9) in November 1983. Note that Micro User used the "Christmas Crackers" name again, for <a href="game.php?id=2717">a different compilation</a> released in 1986 and again in 1987.</p>\r\n<p>The 1983 compilation comprised Sleigh Lander, Christmas Simon, Anagrams, Ski Slope, Carol Quiz, Tic-Tac-Toe, Collect The Trees, Maze Pud, Snow Pud, Chimes, Christmas Word Search, Dodge Dad, Mover, Christmas Keyboard Tester, Blind-Man''s Buff, Forest Run, Halves, Turkey Shoot, Crazy Santa, Christmas Snap, and Santa Skittle.</p>\r\n<p><a href="game.php?id=2717">The 1986 compilation</a> comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-29 15:04:22', '2018-10-29 14:14:32', 2, '2018-10-29 14:17:44', 2, 'N', 'Y', '0'),
(2940, NULL, '', 'Alien Intruders', '1984', 454, 'M', '<p>Published in Games Computing magazine, issue 10, October 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-29 14:34:45', '2018-10-29 14:20:56', 2, '2018-10-29 14:35:30', 2, 'N', 'Y', '0'),
(2941, NULL, '', 'Octonium Moon', '1985', 569, 'M', '<p>Published in "Big K." magazine issue 11 in February 1985.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-29 14:39:15', '2018-10-29 14:38:30', 2, '2018-10-29 14:39:53', 2, 'N', 'Y', '0'),
(2942, NULL, '', 'Higher/Lower', '1982', 38, 'M', '<p>Published in Beebug Magazine volume 1 issue 5 in September 1982.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-29 14:46:02', '2018-10-29 14:43:37', 2, '2018-10-29 14:47:27', 2, 'Y', 'Y', '0'),
(2943, 2785, '', 'Crazy Santa', '1983', 2, 'R', '<p>Part of <a href="http://bbcmicro.co.uk/game.php?id=2785">Christmas Crackers</a></p>\r\n<p>First advertised for sale in Micro User magazine (volume 1, issue 9) in November 1983. Note that Micro User used the "Christmas Crackers" name again, for <a href="http://bbcmicro.co.uk/game.php?id=2717">a different compilation</a> released in 1986 and again in 1987.</p>\r\n<p>The 1983 compilation comprised Sleigh Lander, Christmas Simon, Anagrams, Ski Slope, Carol Quiz, Tic-Tac-Toe, Collect The Trees, Maze Pud, Snow Pud, Chimes, Christmas Word Search, Dodge Dad, Mover, Christmas Keyboard Tester, Blind-Man''s Buff, Forest Run, Halves, Turkey Shoot, Crazy Santa, Christmas Snap, and Santa Skittle.</p>\r\n<p><a href="http://bbcmicro.co.uk/game.php?id=2717">The 1986 compilation</a> comprised Snowplough, Snap, Candle Light, Jet Set Santa, Pull The Cracker, and Name The Carol.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-10-29 15:05:44', '2018-10-29 14:48:18', 2, '2018-10-29 14:50:54', 2, 'N', 'Y', '0'),
(2944, NULL, '', 'Pontoon', '1985', 38, 'M', '<p>Published in "Big K." magazine issue 10 in January 1985.</p>', 1, 5, '', '', '', '', 'V2', '', '', 2, '2018-10-29 14:55:53', '2018-10-29 14:54:53', 2, '2018-10-29 14:57:06', 2, 'N', 'Y', '0'),
(2945, 25, '', 'Chuckie Cheat (AKA Chuckie Egg II) (AKA Chuckie Egg 2) [hack]', '1984', 4, 'L', '<p>Extra levels for the classic <a href="game.php?id=25">Chuckie Egg</a></p>', 1, 4, '', '', '', '', 'Unofficial release', '', '', 3, '2018-11-16 18:22:27', '2018-11-01 17:03:39', 2, '2018-11-01 17:08:10', 2, 'N', 'Y', '0'),
(2946, 25, '', 'Chuckie Egg Professional Edition (AKA Chuckie Egg 2010) [hack]', '2010', 4, 'L', '<p>Extra levels and extra features for the classic <a href="game.php?id=25">Chuckie Egg</a>.</p>\r\n<p>This version is a combination of some of the other patches and hacks <a href="index.php?search=chuckie+egg&amp;sort=b">found here&nbsp;</a>plus joystick support by Pitfall Jones.</p>', 1, 4, 'O', '', '', '', '', '', '', 3, '2018-11-12 11:35:23', '2018-11-01 18:27:07', 2, '2018-11-01 18:31:43', 2, 'N', 'Y', '0'),
(2947, NULL, '', 'Ludo', '1987', 518, 'M', '<p>Published in Micro User Magazine vol.5 issue 3 in May 1987</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-11-12 16:53:11', '2018-11-12 16:51:10', 2, '2018-11-12 16:53:53', 2, 'N', 'Y', '0'),
(2948, NULL, '', 'Goldmine (AKA Gold Mine)', '1985', 21, 'M', '<p>Published in issue 27 of Input magazine. Page 830.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-12 16:58:19', '2018-11-12 16:56:43', 2, '2018-11-12 16:57:21', 2, 'N', 'Y', '0'),
(2949, NULL, '', 'Mars-Lander', '1983', 569, 'M', '<p>Published in Personal Software Magazine Spring 1983.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-12 17:04:20', '2018-11-12 17:02:55', 2, '2018-11-12 17:05:50', 2, 'Y', 'Y', '0'),
(2950, NULL, '', 'Fisherman Fred', '1984', 487, 'M', '<p>Published in Games Computing magazine, issue 1, January 1984.</p>', 1, 1, '', '', '', '', 'V4', '', '', 2, '2018-11-12 17:10:51', '2018-11-12 17:08:22', 2, '2018-11-12 17:11:38', 2, 'N', 'Y', '0'),
(2951, NULL, '', 'Patience', '1984', 38, 'R', '<p>Published on the Micro User "Golden Games" compilation in 1984. The compilation consisted of Bill Bounces Back, Cribbage, Fair Play, Sevens, Which Way, White Widow, Yams, China Drop, Crown Green Bowls, Draw Poker, Explorer Eddie, Master Spy, Patience, and Splat!</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-12 17:19:13', '2018-11-12 17:17:55', 2, '2018-11-12 17:18:33', 2, 'N', 'Y', '0'),
(2952, 25, '', 'Chuckie Egg 2009 (Level-editor) [hack]', '2009', 4, 'L', '<p>This is Dave Edwards''s original Acorn Electron release of Chuckie Egg 2009, which comes with eight new levels for the classic <a href="game.php?id=25">Chuckie Egg</a>. The new levels were designed with the included level-editor, which was also created by Dave Edwards.&nbsp;</p>\r\n<p>Chuckie Egg 2009 was published on the 8BS public-domain disc TBI-185.</p>\r\n<p>The new levels (<em>without</em> the level-editor) were published on the Electron User Group PD Disc 70 in 2009. They are also available as&nbsp;<a href="game.php?id=1840">a standalone game</a>, which is compatible with the BBC Micro Model B.</p>\r\n<p>The level-editor, included in this original release, is compatible with the BBC Master, but <em>not</em> with the Model B.</p>', 1, 1, '', '', '', 'Y', '', '', '', 3, '2018-11-16 18:23:30', '2018-11-13 11:55:29', 3, '2018-11-13 12:07:25', 3, 'N', 'N', 'Y'),
(2953, NULL, '', 'Odd One Out', '1989', 29, 'M', '<p>Published in Micro User Magazine vol.7 issue 3 in May 1989</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-11-13 16:48:59', '2018-11-13 16:48:59', 2, '2018-11-13 16:49:43', 2, 'N', 'Y', NULL),
(2954, NULL, '', 'Serpents', '1983', 1, 'M', '<p>This game was published in the winter 1983 issue of Personal Software magazine.</p>', 2, 2, '', '', '', '', '', '', '', 2, '2018-11-13 17:13:23', '2018-11-13 17:12:27', 2, '2018-11-13 17:13:57', 2, 'N', 'Y', '0'),
(2955, NULL, '', 'Pentiles', '1983', 17, 'R', '<p>Alan Gray published a <a href="http://bbcmicro.co.uk/game.php?id=1376">similar game</a> in Beebug Magazine volume 11 issue 5 in October 1992.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-13 17:17:30', '2018-11-13 17:17:30', 2, '2018-11-13 17:18:09', 2, 'N', 'Y', NULL),
(2956, NULL, '', 'Simon (AKA Pattern Memory)', '1982', 565, 'M', '<p>Published in Your Computer Magazine volume 2 issue 10 in October 1982.</p>\r\n<p><strong>This game is very difficult to play on a modern keyboard because of the different layout of the cursor keys to those on a BBC Micro.</strong></p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-13 17:28:43', '2018-11-13 17:27:02', 2, '2018-11-13 17:27:41', 2, 'N', 'Y', '0'),
(2957, NULL, 'The', 'Times Crossword Program - The Times Jubilee Puzzles 1932 to 1987', '1988', 17, 'R', '<p><a href="http://www.everygamegoing.com/egg/landingItem/index/machine_type_group_default_folder/electron/publisher_folder/akom/format_folder/3_5_discs/item_title/The-Times-Crosswords-Jubilee-Puzzles/">Full instructions</a> at EveryGameGoing.com.</p>\r\n<p>The crosswords themselves are (c) News International PLC.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-23 11:09:48', '2018-11-19 19:34:23', 2, '2018-11-19 19:36:01', 2, 'N', 'Y', '0'),
(2958, NULL, 'The', 'Times Crossword Program - The Times Computer Crosswords Volume 1', '1987', 17, 'R', '<p><a href="http://www.everygamegoing.com/egg/landingItem/index/machine_type_group_default_folder/electron/publisher_folder/akom/format_folder/tapes/item_title/The-Times-Crosswords-Volume-1">Full instructions</a> at EveryGameGoing.com.</p>\r\n<p>The crosswords themselves are (c) News International PLC.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-23 09:55:04', '2018-11-23 09:49:19', 2, '2018-11-23 09:54:23', 2, 'N', 'Y', '0'),
(2959, NULL, '', 'Bomber', '1992', 2, 'M', '<p>Published in the September 1992 issue of BBC Acorn User.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-23 10:05:53', '2018-11-23 10:03:32', 2, '2018-11-23 10:04:55', 2, 'Y', 'Y', '0'),
(2960, NULL, '', 'Espionage', '1987', 13, 'M', '<p>Published in Micro User Magazine vol.5 issue 5 in July 1987</p>', 1, 1, 'O', '', '', '', '', '', '', 2, '2018-11-23 10:10:14', '2018-11-23 10:09:02', 2, '2018-11-23 10:11:00', 2, 'N', 'Y', '0'),
(2961, NULL, '', 'ICBM Attack!!!', '1984', 2, 'M', '<p>Published in issue 16 of Laserbug user group magazine which would have been the November 1983 issue, but delays meant the magazine was not published until early 1984.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-23 10:49:22', '2018-11-23 10:13:43', 2, '2018-11-23 10:15:32', 2, 'N', 'Y', '0'),
(2962, NULL, '', 'Laserbug Grand Prix', '1983', 467, 'M', '<p>Published in issue 09 of Laserbug user group magazine in February 1983.</p>', 1, 1, '', '', '', '', '', '', '', 2, '2018-11-23 10:17:28', '2018-11-23 10:17:28', 2, '2018-11-23 10:18:03', 2, 'N', 'Y', NULL),
